import React from "react";
import {  Route, Routes } from "react-router-dom";
import LandingPage from "./LandingPage";
import Home from "./Home";
//import Test from "./Test";





function App() {


  return (
    <div>
      <Routes>
      <Route path="/" element={<LandingPage /> }       />
      <Route path="/Home" element={<Home /> }       />

      </Routes>
    </div>
  );
}

export default App;
